//each window is five seconds
//buckets based on specified time interval
//takes advantage of usual distribution of notes in music
var BucketMaster = function(data, bucketTime){
	var buckets = [];

	function addToBucket(bucketNum, timeEvent){
		var bucket = buckets[bucketNum];
		// console.log(bucket)
		// if(bucket[Math.floor(time/bucketTime)])
		if(bucket){
			bucket.push(timeEvent)
		}else{
			buckets[bucketNum] = [timeEvent]
		}
	}

	function init(){
		for(var i = 0; i < data.length; i++){

			var timeEvent = data[i];

			if(timeEvent.isInterval){
				// console.log(timeEvent)
				//drop interval events over all buckets they span

				var firstBucket = getBucketNum(timeEvent.startTime);
				var lastBucket = getBucketNum(timeEvent.endTime);


				for(var j = firstBucket; j <= lastBucket; j++){
					addToBucket(j, timeEvent)
				}
			}else{
				//if just normal event, drop in corresponding bucket
				// buckets[getBucketNum(timeEvent.startTime)].push(timeEvent);
				addToBucket(getBucketNum(timeEvent.startTime), timeEvent)

			}
		}

		//fill in empty
		for(var k = 0; k < buckets.length; k++){
			if(!buckets[k]){
				buckets[k] = [];
			}
		}
	}

	function getBucketNum(time){
		return Math.floor(time/bucketTime)
	}


	function forEachInInterval(start, end, f){
		var startBucket = getBucketNum(start);
		var endBucket = getBucketNum(end);

		var seenIntervals = {}


		for(var n = startBucket; n <= endBucket; n++){
			var bucket = buckets[n]
			if(bucket){
				for(var k = 0; k < bucket.length; k++){
					var timeEvent = bucket[k]

					//not all events in the buckets are actually in the view

					//intervals can be spread across multiple buckets
					//so remove duplicates
					if(timeEvent.isInterval && !seenIntervals[timeEvent]){
						//if overlap
						if(!(timeEvent.startTime > end || timeEvent.endTime < start)){
							f(timeEvent);
						}
						seenIntervals[timeEvent] = true;
					}
					else{
						if(timeEvent.startTime > start && timeEvent.startTime < end){
							f(timeEvent);
						}

					}					
				}
			}
		}
	}

	return {
		init: init,
		buckets: buckets,
		forEachInInterval: forEachInInterval
	}
};


