window.onload = function(){
	var meter = new FPSMeter();

	var renderer = new PIXI.WebGLRenderer(800, 600);
	document.body.appendChild(renderer.view);

	var stage = new PIXI.Container(0x888888);
	var start = 10.0
	var stop = 20.0
	var graphics = new PIXI.Graphics();
	stage.addChild(graphics);

	function draw(){
		
		graphics.clear();
		var width = stop - start

		graphics.beginFill(0xe74c3c); // Red

		bucketSan.forEachInInterval(start, stop, function(note){

			// console.log(stage.width)

			var containerWidth = 800
			var containerHeight = 600

			var highNote = 60

			var numNotes = 30

			var noteHeight = containerHeight/numNotes


			var noteFromTop = highNote - note.note

			// console.log(noteFromTop)

			if(noteFromTop < numNotes){
				var p_xStart = (note.startTime - start)/width * containerWidth
				// var p_xEnd = (note.endTime - stop)/width * stage.width
				var p_width = (note.endTime - note.startTime)/width * containerWidth


				var p_y = noteFromTop * noteHeight

				// if(p_xStart < 0){
				// 					console.log(p_xStart)

				// }
				// console.log(p_width)

				graphics.drawRect(p_xStart, p_y, p_width, noteHeight)
				// console.log(stage)

			}
		});
		graphics.endFill();
	}

	

	animate();
	function animate() {
		draw();
		start += 0.01
		stop += 0.01
		requestAnimationFrame(animate);
		renderer.render(stage);
		meter.tick();

	}








}














